import "./blog.css";
import Logo from "../../img/logo.png";
import NavBar from "../../components/navBar/navBar";

export default function Blog(){
    return(
        <div className="Blog">
             <NavBar Logo={Logo}/>

            <div className="blogTop">
              <div className="blogSide">
                  <h1>Blog</h1>
              </div>
            </div>

            <div className="blogBody">
                <div className="blogTitle">
                    <h3>Blog&Article</h3>
                    <h1>Recent Blog</h1>
                </div>
            </div>
          
        </div>
    );
}
